import React, { useState } from "react";
import { FaPlus, FaShoppingCart, FaUser } from "react-icons/fa";
import { Link } from "react-router-dom";
import useAuth from "../hooks/useAuth";
import "./NavBar.css"; // Assurez-vous que le chemin est correct

const NavBar = () => {
  const { user, loading, isAdmin } = useAuth();
  // Ajout de messages de débogage
  console.log("User:", user);
  console.log("Loading:", loading);
  console.log("Is Admin:", isAdmin);

  if (loading) {
    return <nav className="navbar">Chargement...</nav>;
  }
  const [name, setName] = useState("");
  const [price, setPrice] = useState("");

  return (
    <nav>
      <div className="logo">
        <Link to="/">GameShop</Link>
      </div>
      <ul className="nav-links">
        {/* {isAdmin && ( */}
        <li className="productform">
          <Link to="/product-form">
            <FaPlus />
          </Link>
        </li>
        {/* )} */}
        <li className="UserLogin">
          <Link to="/login">
            <FaUser />
          </Link>
        </li>
        <li className="shoppingCart">
          <Link to="/shopping-cart">
            <FaShoppingCart />
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
